def entrance(data):

    class PriorityQueue:

        def __init__(self):
            self.queue = []

        def enqueue(self, data):
            self.queue.append(data)

        def dequeue(self):
            if self.queue:
                min_item = min(self.queue)
                self.queue.remove(min_item)
                return min_item
            else:
                return None
